const initialState = {
    dogsLoaded: []
}


export default  function rootReducer(state = initialState, action) {
    switch(action.type) {
        case 'GET_DOGS':
            return {
                ...state,
                dogsLoaded: action.payload
            }
        case 'RESET':
            return {
                dogsLoaded: []
            }    
        default:
            return state    

    }

}
